                <h1 class="h1-display pt-xs-2 mt-xs-2 bt-xs-1 mb-xs-2">Creative Origins: Vacilando Quilting</h1>

                <p class="h4-display text-larger excerpt text-gray mb-xs-3">Find out how a painter-turned-quilter launched her own business while roaming the US in a travel trailer.</p>

               
            </hgroup>

                               

            
            <article class="prose prose-article pb-xs-4 pb-md-6">
                <figure><img alt="" src="https://i.etsystatic.com/inv/47aac8/2738296588/inv_fullxfull.2738296588_3b9m5u47.jpg?version=0"></figure><p>It takes a bold spirit to say “yes” to a year-long road trip in a travel trailer with someone they’ve been dating for four months, but in 2013, that’s exactly what Laura Preston. If that wasn’t enough, she took up quilting with no prior experience and launched her own business for her creations, all while driving around the US. Prior to swapping her New York City lifestyle for a nomadic one with her then-boyfriend (now husband) John, Laura was a painter. “I thought it would be so dreamy and romantic to have time and space to paint outside,” says Laura. “I didn't realise that painting large-scale oil paintings in this 200-square-foot trailer that moves every few days just doesn't work.”</p>
<p>They had been on the road for about eight months when Laura started searching for a different creative outlet. “I came across these modern quilters who were making works of art with fabric”, she says. “I had never seen anything like it before.” Armed with some YouTube videos and a mishmash of crafting blogs, Laura pieced together her own quilting education. Less than two years later, <a href="https://www.etsy.com/in-en/shop/VacilandoQuilting">Vacilando Quilting</a> was open for business and Laura was still roaming the country with John. The couple’s journey turned into a six-year excursion, and it wasn’t until last year that they set up camp permanently, in San Marcos, Texas.</p>
<p>With the trailer now reserved for holidays, Laura couldn’t be happier with the space (and stillness) of her home studio. Their move came at exactly the right time, as there was no predicting how 2020 would affect Vacilando Quilting. “After the pandemic started, I thought that things were going to get really slow”, says Laura. “But it turns out everyone wanted a quilt since they were stuck at home, and to support small businesses in the process.” This has been Laura’s busiest year on Etsy yet. She’s hired multiple production quilters to keep up with demand, more than doubling the size of her team in just six months.</p>
<p>Read on to find out how Laura’s wanderlust takes shape in her designs and what she’s learned about handling unexpected challenges along the way.</p>
<figure><img alt="" src="https://i.etsystatic.com/inv/5c6ddc/2773974733/inv_fullxfull.2773974733_lmuyjhss.jpg?version=0"></figure><h2>What inspires your designs?</h2>
<p>While I was travelling, my landscape in my garden was different every week which was an endless source of inspiration. Everything that I design is inspired by a place that I've visited, whether that's the colours of a sunset or the shapes that the framing of the house creates or just the feeling of a place. Living in an Airstream, I was outside so much more. As I went on hikes and saw these beautiful landscapes, I felt like I was more present and more able to notice colours and shapes. I try and distil their shapes down to their most simplest form and turn that into a quilt. A little light bulb goes off in my head when I see something cool-looking, and I’ll take a photo. I share those photos in my item listings because I feel like it gives the design more of a purpose. People can see where the design came from instead of just wondering how the artist got to that point.</p>
<figure><img alt="" src="https://i.etsystatic.com/inv/16b523/2773960429/inv_fullxfull.2773960429_czxle7jr.jpg?version=0"><figcaption><img alt="" src="https://i.etsystatic.com/inv/fa7cd1/2773961853/inv_fullxfull.2773961853_sepmwguw.jpg?version=0"><img alt="" src="https://i.etsystatic.com/inv/1b5e09/2726272054/inv_fullxfull.2726272054_kzzgg82j.jpg?version=0"></figcaption></figure><h2>What drew you to quilting over other textile work, like sewing or weaving?</h2>
<p>A quilt is like a 2-D painting on a piece of fabric that you can use. I gravitated towards it as a practical, useful household object that could also be so beautiful. There's more sentimentality in a quilt. It’s handmade by someone who loved making it and made it with so much care, and it becomes part of your home and your family. It's this embodiment of comfort. That's what makes it really special. It combines all of these things, like art, history, and craft, that are so important to me but also to other people. A big part of why I do what I do is to carry on that tradition and share it with others. And just having all of that rolled into one super cosy thing that you can just wrap up in every night is worth the time and patience it takes to make it.</p>
<h2>You had to scale your business unexpectedly this year. What did you learn from that experience?</h2>
<p>The puzzle of trying to figure out how to get more quilts to more people is a fun challenge. Expanding your team can be scary, but it’s probably the best investment I’ve made in my business so far. It allows me to focus on the things I’m best at and work on the bigger picture instead of being reactive and stuck in the day-to-day production. I hired people to do the things I’m weakest at so I can focus on the things I find the most joy in doing. If you’re looking to hire employees, trust your intuition. Those gut feelings will guide you when it comes to hiring the right person.</p>
<p>Growing pains can be exhausting, but they don’t last forever. Focus on that light at the end of the tunnel. Remember: You are incredibly capable of doing hard things. I always remind myself that this is my business, one that I created and can run however I think is best. This means that if I need to make a change, raise prices to adjust the demand, or stop selling something that doesn’t work for me or my business, I can make that decision. I’ve been trying to give my team plenty of grace during these crazy times, as well as take care of myself, my body, and my mental health.</p>
<figure><img alt="" src="https://i.etsystatic.com/inv/6d2b83/2775532107/inv_fullxfull.2775532107_e4umn1zx.jpg?version=0"></figure><h2>You sell a quilt pattern in your shop and many people are taking up DIY hobbies this year. What was that like and what tips do you have about selling kits, tutorials, or DIYs?</h2>
<p>I wanted to give people something that was comprehensive and had all of the information they would need to make a quilt from start to finish. I wrote it in a way that was going to be approachable and I wanted it to be a different type of quilting pattern. It was a fun process to make a pattern my own. I love sharing the knowledge that I’ve gathered over the years and making quilting as simple and easy as possible. I also love inspiring people to get creative and trust their own unique style and design decisions.</p>
<p>Craft education isn’t a quick and easy passive income. It takes a lot of marketing to make a pattern, tutorial, or kit successful. I get lots of questions about the quilt patterns via email and Instagram every week, and I try to share the quilts people make on social media. That takes time that I didn’t expect to be spending outside of writing the pattern. Make sure that teaching and educating is something that you love to do before diving into writing patterns or tutorials.</p>
<figure><img alt="" src="https://i.etsystatic.com/inv/980137/2727846302/inv_fullxfull.2727846302_i2osfwhr.jpg?version=0"><figcaption>Laura's Sea Stack Quilt is inspired by the rocky sea stacks that dot the coastline of Northern California, Oregon and Washington.</figcaption></figure><h2>Tell me about a meaningful connection you’ve made on Etsy.</h2>
<p>I collaborated with April of the home decor shop <a href="https://www.etsy.com/in-en/shop/littlekorboose/">Little Korboose</a>, and we’re dear friends now. She puts a lot of emphasis on being as sustainable as possible and not wanting to add their textile scraps to the landfill. She had tons of fabric scraps left over from their screen-printed tea towels, so we worked <a href="https://www.etsy.com/listing/693454219/little-korboose-x-vacilando-quilting">together on a design</a>. Our collaboration has always been really natural, and we both have a lot of respect for each other. We also collaborated on pieces that were inspired by a trip we took to Peru.</p>
<p>Collaborating with other creatives is such a gratifying way to expand your creativity. Getting someone else's feedback and seeing something through their eyes and incorporating that into your work just makes your work stronger. I've done a few collaborations with various creatives and companies, and they've all been great learning experiences.</p>
<p><em>Have you made any special connections through Etsy? Share your story in the comments below.</em></p>
<p>Photographs provided by Laura Preston and her husband, John Ellis.</p>
            </article>

                                

            
            
            
            
